import React from 'react';

function Services() {
  return (
    <div>
      <h2>Our Services</h2>
      <ul>
        <li>
          <h3>Residential Construction</h3>
          <p>We offer comprehensive residential construction services, from new builds to renovations.</p>
        </li>
        <li>
          <h3>Commercial Projects</h3>
          <p>Our team handles commercial construction projects with a focus on quality and efficiency.</p>
        </li>
        <li>
          <h3>Remodeling & Renovation</h3>
          <p>Transform your space with our remodeling and renovation services.</p>
        </li>
      </ul>
    </div>
  );
}

export default Services;
